import React from 'react';
import { NavLink } from 'react-router-dom';

import './NavLinks.css';

const NavLinks = () => {
    return (
        <ul className="nav-links">
            <li>
                <NavLink to="/" exact>
                    HOME
                </NavLink>
                <NavLink to="/123/places">
                    MY PLACES
                </NavLink>
                <NavLink to="/places/new">
                    ADD PLACES
                </NavLink>
                <NavLink to="/auth">
                    AUTHENTICATE
                </NavLink>
            </li>
        </ul>
    )
}

export default NavLinks;
